import React from 'react';
import classes from './Layout.module.css';

const layout = (props) => {
    return (
        <div>
            <p>logo</p>
            <ul>
                <li><a href="/">Home</a></li>
                <li><a href="/">About</a></li>
                <li><a href="/">Services</a></li>
                <li><a href="/">Knowledge Portal</a></li>
            </ul>
        </div>
    );
}

export default layout;
